import { Box, Card, CardContent, CardHeader, Container, Grid, Paper, Typography } from '@mui/material'
import { withStyles } from '@mui/styles'
import React from 'react'

const styles = {
    mainGridClass:{
        backgroundColor:'lightBlue',
        padding:'20px',
        borderRadius:'50px',
        display:'flex',
        alignItems:'center',
        justifyContent: 'center'
    },
    innerBoxClass1:{
        padding:'20px',
        backgroundColor:'orange'
    }

}


function ProfileComponent(props) {
    const {classes} = props;
  return (
    <>  <Paper>
        <Container>
        <Grid className={classes.mainGridClass}>
            <Box className={classes.innerBoxClass1}>
                <Card>
                    <CardHeader>
                        Welcome
                    </CardHeader>
                    <CardContent>
                        Hello Guys
                    </CardContent>
                </Card>
            </Box>
            </Grid></Container>
        </Paper>
    </>
  )
}
export default withStyles(styles) (ProfileComponent)
